import React from "react"
import { useStaticQuery, graphql } from "gatsby"
import styled from "styled-components"
import BackgroundImage from "gatsby-background-image"
import Button from "../Button/button"
import { Link } from "react-scroll"
import { motion } from "framer-motion"

const Banner = () => {
  const data = useStaticQuery(graphql`
    query {
      file(relativePath: {}) {
        childImageSharp {
          fluid(maxWidth: 2000, quality: 90) {
            ...GatsbyImageSharpFluid_withWebp
          }
        }
      }
    }
  `)

  const variants = {
    visible: { opacity: 1, y: 0 },
    hidden: { opacity: 0, y: 20 },
  }

  return (
    <BannerWrapper>
      <BackgroundImage Tag="section" className="hero-image" fluid={data}>
        <div className="dot dot_big" />
        <div className="dot dot_small" />
        <div className="ring ring_small" />
        <div className="left-circle" />
        <div className="right-circle" />
        <div className="right-circle_gray" />
        <div className="hero-content">
          <motion.span
            className="top-slug"
            initial="hidden"
            animate="visible"
            variants={variants}
            transition={{ ease: "easeOut", duration: 0.8, delay: 0.5 }}
          >
            <div className="line-slug"></div>
            Wiseworks
          </motion.span>
          <motion.h1
            initial="hidden"
            animate="visible"
            variants={variants}
            transition={{ ease: "easeOut", duration: 0.8, delay: 1 }}
          >
            Iâ€™m creating websites <br />
            for your needs.
          </motion.h1>
          <motion.p
            initial="hidden"
            animate="visible"
            variants={variants}
            transition={{ ease: "easeOut", duration: 0.8, delay: 1.5 }}
          >
            Young developer from Poland who loves web design and web
            development.
          </motion.p>
          <Link className="recent_work" to="perks" smooth={true} duration={500}>
            <motion.span
              initial="hidden"
              animate="visible"
              className="button_cta"
              variants={variants}
              transition={{ ease: "easeOut", duration: 0.8, delay: 1 }}
            >
              Recent Work
            </motion.span>
          </Link>
          <motion.ul
            initial="hidden"
            animate="visible"
            className="socials"
            variants={variants}
            transition={{ ease: "easeOut", duration: 0.8, delay: 2 }}>
            <li><a className="linkedin" href=""></a></li>
            <li><a className="github" href=""></a></li>
            <li><a className="codepen" href=""></a></li>
          </motion.ul>
          <Link className="scroll_down" to="perks" smooth={true} duration={500}>
            <motion.span
              initial="hidden"
              animate="visible"
              className="scrolldown"
              variants={variants}
              transition={{ ease: "easeOut", duration: 0.8, delay: 1.5 }}
            >
              scroll down
            </motion.span>
          </Link>
        </div>
      </BackgroundImage>
    </BannerWrapper>
  )
}

